import {useContext} from "react";
import { ShoppingCartContext } from "../../App";

let ShoppingCart = function () {
    let x = useContext(ShoppingCartContext)
    return (
        <>
            <shopping-cart>
                {x.name }
                {x.age }
                {x.job}
            </shopping-cart>
        </>
       
    )
};

export default ShoppingCart;
